import React from "react";
const url = 'http://localhost:8089/api/coin/getAllCoin';
const token = localStorage.getItem('token');
const AuthStr = 'Bearer '.concat(token);
export default class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            error: undefined,
            isLoaded: false,
            coins : []
        }
        this.getData = this.getData.bind(this);
    }
   componentDidMount(){
     this.getData();
    }
    getData () {
        return fetch(url, {
          method: 'GET',
         
          headers:{
              "Accept-Language": "application/json",
              "Authorization": "Bearer " +AuthStr,
              "Access-Control-Allow-Origin":"http://localhost:8089/",
             },
            
        })
            .then(res => res.json())
            .then(
              (result) => {
                this.setState({
                  isLoaded: true,
                  items: result
                });
              },
              (error) => {
                this.setState({
                  isLoaded: true,
                  error
                });
              }
            )
        }
      
    render(){
        return (
            <div> 
            <h1>Coin List</h1>  
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>

        )
       
    }
}
